--*** AÑADIENDO POLITICA PAGO
ALTER TABLE FITBANK.TCSOLICITUDPAGO ADD CPOLITICAPAGO NUMBER(4) DEFAULT NULL;

---- *** CREACIÓN DE LAS TABLAS: TPOLITICASPAGOID Y TPOLITICASPAGO 
--TPOLITICASPAGOID
CREATE TABLE
    FITBANK.TPOLITICASPAGOID
    (
        CPOLITICAPAGO NUMBER(4) NOT NULL,
        CONSTRAINT IPKPOLPAGID PRIMARY KEY (CPOLITICAPAGO)
    );
COMMENT ON TABLE FITBANK.TPOLITICASPAGOID
IS
    'Códigos de las políticas de pago en módulo de Compras.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGOID.CPOLITICAPAGO
IS
    'Código de la política de Pago.';


--TPOLITICASPAGO
CREATE TABLE
    FITBANK.TPOLITICASPAGO
    (
        CIDIOMA VARCHAR2(3) NOT NULL,
        CPOLITICAPAGO NUMBER(4) NOT NULL,
        FHASTA TIMESTAMP(6) NOT NULL,
        VERSIONCONTROL NUMBER(22) DEFAULT 0,
        FDESDE TIMESTAMP(6) NOT NULL,
        DESCRIPCION VARCHAR2(120) NOT NULL,
        CONSTRAINT IPKPOLPAG PRIMARY KEY (CIDIOMA, CPOLITICAPAGO, FHASTA),
        CONSTRAINT FKIDIPOLPAG FOREIGN KEY (CIDIOMA) REFERENCES "TIDIOMASID" ("CIDIOMA"),
        CONSTRAINT FKPOLPAGID FOREIGN KEY (CPOLITICAPAGO) REFERENCES
        FITBANK.TPOLITICASPAGOID ("CPOLITICAPAGO")
    );
COMMENT ON TABLE FITBANK.TPOLITICASPAGO
IS
    'Descripción por idioma de los códigos de la política de Pago.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.CIDIOMA
IS
    'Codigo del idioma.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.CPOLITICAPAGO
IS
    'Código de la política de Pago.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.FHASTA
IS
    'Fecha hasta la que esta vigente la descripcion de la política de Pago.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.VERSIONCONTROL
IS
    'Manejo de optimistic locking.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.FDESDE
IS
    'Fecha desde la que esta vigente la descripcion de la política de Pago.';
COMMENT ON COLUMN FITBANK.TPOLITICASPAGO.DESCRIPCION
IS
    'Descripcion la política de Pago.';

